INSERT INTO public.pop_feedback (id, text, "timestamp", player_id) VALUES (3, 'Trasa super, každopádně v místě některých zastávek nebyl signál, tedy nešlo naskenovat QRkód. Taky by se hodilo vidět někde na stránkách info o tom, kdy se bude losovat tombola. ', '2023-07-05 15:00:00', 1141);
INSERT INTO public.pop_feedback (id, text, "timestamp", player_id) VALUES (4, 'Myšlenka aplikace nebyla špatná. Ale ikdyž jsem měl plně nabitý telefon i neomezená data, tak na stanovišti u cyklopartyje absolutně žádný signál a tedy bez známky. Tu jsem jen vyfotil, ale už se jí nepodařilo do aplikace přidat. Tak snad příště raději klasické kartičky a razítka. Jinak příjemná akce.', '2023-07-05 15:00:00', 1204);
INSERT INTO public.pop_feedback (id, text, "timestamp", player_id) VALUES (5, 'Velká gratulace pořadatelům,super akce, už se těším na další ročník 😁', '2023-07-05 15:00:00', 1012);
